import React from "react";
import ReactDOM from "react-dom";
import {BrowserRouter as Router, Route, Routes} from "react-router-dom";
import App from "./app";
import Auth from "./auth";
import "../public/styles.css";

// defines how the page will render
// set up the routes and related pages
// set up the logic to link between auth and app (e.g. once signed out back to the auth page; once signed in, directed to the app page)

ReactDOM.render (
    <Router>
        <Routes>
            <Route path='/game' component={App}/>
            <Route path='/' component={Auth}/>
        </Routes>
    </Router>,
    document.getElementById('root'));
